import React from 'react';
import './home.css';
import Title from './Title.js';
import ProfileImage from './ProfileImage.js';

const Home = () => {
  const createBackgroundBubbles = () => {
    for (let i = 0; i < 100; i++) {
      const bubble = React.createElement({'className': 'backgroundBubble'}, 'div');
    }
  }

  return (
    <div className='home'>
      {createBackgroundBubbles()}
      <ProfileImage />
      <Title />
    </div>
  );
}

export default Home;
